import React, { Component } from 'react';
import cover from '../img/aboutuscover.jpg';
import './aboutus.css';

class AboutUs extends Component {
    state = {  }
    render() { 
        return ( 
            <React.Fragment>
                <div className="container">
                    <div className="body">
                        <div className="cover">
                            <img className="cover-img" src={cover} alt=""/>
                        </div>
                    </div>
                </div>
            </React.Fragment>
         );
    }
}

export default AboutUs;
